import axios from "axios";
import Cookies from 'js-cookie';

export default axios.create({
    baseURL: 'http://localhost:8000',
    withCredentials: false,
    withXSRFToken: true,
    headers: {
        'Authorization': `Bearer ${Cookies.get('token')}`
    }
})
